import styles from './style.module.css';

interface CategoryButtonProps {
  categoryId: number;
  categoryName: string;

}

export default function CategoryButton({ categoryId, categoryName}: CategoryButtonProps) {

  const className = styles.categoryButton;
  return (
    <button className={styles.categoryNavbar} >
      {categoryName}
    </button>
  );
}
